/* --- SUBCOMPONENTS --- */

function FunnelCard({ icon, title, value, change, color, borderColor, shadowColor, children, isNeutral = false }: FunnelCardProps) {
  return (
    <motion.div 
      whileHover={{ x: 2, backgroundColor: "rgba(17, 34, 64, 0.8)" }}
      className="bg-[#0a192f]/40 border border-[#233554]/60 rounded p-2.5 flex items-center justify-between group cursor-pointer relative overflow-hidden h-16"
    >
       <div className="flex items-center gap-3 relative z-10">
          <div className={`w-8 h-8 rounded bg-[#0a192f] border flex items-center justify-center ${color} ${borderColor}`} style={{ boxShadow: `0 0 10px ${shadowColor}` }}>
             {icon}
          </div>
          <div>
             <p className="text-[9px] font-bold text-slate-500 uppercase tracking-tight">{title}</p>
             <p className={`text-sm font-black tabular-nums leading-none mt-0.5 ${isNeutral ? 'text-slate-300' : 'text-white'}`}>{value}</p>
          </div>
       </div>
       <div className="w-12 h-6 opacity-50 relative z-0">
          {children}
       </div>
    </motion.div>
  );
}

function TargetItem({ initials, name, tier, value, status, statusColor, iconColor, iconBg, iconBorder, progress }: TargetItemProps) {
  const barColor = statusColor.includes('emerald') ? '#34d399' : (statusColor.includes('#f59f0a') ? '#f59f0a' : '#00d2ff');

  return (
    <div className="flex items-center justify-between p-2 rounded bg-[#0a192f] border border-[#233554] hover:border-[#00d2ff]/30 transition-colors cursor-pointer group">
      <div className="flex items-center gap-2">
        <div className={`w-6 h-6 rounded ${iconBg} border ${iconBorder} flex items-center justify-center font-black text-[9px] ${iconColor}`}>
          {initials}
        </div>
        <div>
          <p className="text-[10px] font-bold text-white group-hover:text-[#00d2ff] transition-colors leading-none">{name}</p>
          <p className="text-[8px] text-slate-500 uppercase leading-none mt-0.5">{tier}</p>
        </div>
      </div>
      <div className="text-right">
        <p className="text-[10px] font-bold text-white tabular-nums leading-none">{value}</p>

        {/* Progress Bar Container */}
        <div className="flex items-center gap-1.5 mt-1">
           <div className="w-10 h-1 bg-[#112240] rounded-full overflow-hidden border border-[#233554]/50">
             <motion.div 
               className="h-full rounded-full"
               style={{ backgroundColor: barColor, boxShadow: `0 0 4px ${barColor}` }}
               initial={{ width: 0 }}
               animate={{ width: `${progress}%` }}
               transition={{ duration: 1, delay: 0.2 }}
             />
           </div>
        </div>
      </div>
    </div>
  );
}

function CompactStat({ label, value, trend, isUp, isFlat }: { label: string, value: string, trend: string, isUp: boolean, isFlat?: boolean }) {
  return (
    <div className="bg-[#112240]/40 p-2 rounded border border-[#233554]/50">
      <p className="text-[8px] text-slate-500 uppercase font-bold tracking-wider mb-0.5">{label}</p>
      <div className="flex items-baseline justify-between">
         <p className="text-xs font-black text-white">{value}</p>
         <div className={`flex items-center gap-0.5 text-[8px] font-bold ${isFlat ? 'text-slate-500' : (isUp ? 'text-emerald-400' : 'text-rose-400')}`}>
            {!isFlat && <ArrowUp size={8} className={isUp ? "" : "rotate-180"} />}
            {trend}
         </div>
      </div>
    </div>
  );
}

