                      </linearGradient>
                      <mask id="dashedLineMask">
                        <motion.path 
                          d="M0 55 C 30 55, 45 52, 65 35 S 85 20, 100 30" 
                          fill="none" 
                          stroke="white" 
                          strokeWidth="3"
