                      {/* Core Dot */}
                      <circle cx="85" cy="18" r="4" fill="#00d2ff" />
                    </motion.g>
                  </svg>
               </div>
            </div>

            {/* Target List - Expanded to fill bottom */}
            <div className="flex-1 flex flex-col overflow-hidden min-h-0">
               <div className="flex items-center justify-between mb-2">
